    "inventory-reptile-and-amphibians-of-southern-oregon-islands-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "This inventory is part of a larger effort
    to assess the occupancy of breeding burrow-nesting seabirds (e.g., Leachu2019s storm-petrels)
    that are being monitored to determine the effects of predators.  The inventory of
    reptiles and amphibian on these off-shore islands required biologists to access
    the islands via foot during low tides (Saddle Rock), swim tidal channels or access
    by boat (Goat Island and Hunters Island).  Once on island, biologists systematically
    traversed the island using low pressure snowshoes (i.e., reducing potential burrow
    or sensitive habitat damage) to obtain evidence of or capture all animals on island.
     A systematic search of the islands for terrestrial vertebrates/invertebrates had
    not been completed previously. All on-island work over the past 30 years has involved
    the inventory and monitoring of seabirds.",nt"license_title": "License Not
